function Card(props) {
    
    function handleClick() {
        props.onCardClick(props.card);
    }

    return (
        <li className="element">
            <img className="element__image" src={props.link} alt={props.name} onClick={handleClick} />
            <button class="element__delete-button" type="button" title="Удалить"></button>
            <div className="element__info">
                <h2 className="element__caption">{props.name}</h2>
                <div className="element__like-container">
                    <button className="element__like-button" type="button" title="Нравится" />
                    <h3 className="element__like-counter">{props.likes}</h3>
                </div>
            </div>
        </li>
    )
}

export default Card;
